import React, {Component} from "react";
import Tabs from '@mui/material/Tabs';
import Tab from '@mui/material/Tab';
import { withStyles } from '@material-ui/styles';
import IconButton from '@material-ui/core/IconButton';
import ReplayIcon from '@material-ui/icons/Replay';
import CloseIcon from '@mui/icons-material/Close';


const useStyles = theme => ({
    root: {

    },
    tabs: {
        minWidth: 50,
        position: 'absolute',
        top: -8,
        borderRadius: '0px 0px 0px 20px',
        color: 'white'
    },
    tab: {

    },
    tabLabel: {
        marginTop: 7,
        fontWeight: 600,
        fontStyle: 'verdana'
    },
    indicator: {

    }
});

class NavTop extends Component {

    render(){

        const showNav = this.props.state.showNav

        return(
            <>
                <div className={`reset-options-container nav-top-${showNav ? 'active' : 'inactive'}`}>
                    <div className='topNav-reset-container'>
                        <IconButton onClick={this.props.clearGrid} color="primary">
                                <CloseIcon className="erase-btn" />
                        </IconButton>
                    </div>
                    <div className='topNav-erase-container'>
                        <IconButton onClick={this.props.resetGrid} color="primary">
                                <ReplayIcon className="reset-btn" />
                        </IconButton>
                    </div>
                </div>
                <div className="progress-bar-container">
                    <filler className='progress'/>
                </div>
                <div className={`speed-options-container nav-top-${showNav ? 'active' : 'inactive'}`} sx={{ width: '100%' }}>
                <Tabs
                    // value={value}
                    // onChange={handleChange}
                    TabIndicatorProps={{style: {background:'red'}}}
                    textColor="secondary"
                    indicatorColor="secondary"
                    aria-label="secondary tabs example"
                    className={this.props.classes.tabs}
                    value={this.props.state.animationSpeed}
                    onChange={this.props.handleSpeedTabs}
                    variant="fullWidth"
                >
                    <Tab className={this.props.classes.tab} id='fullReset' value={20} label={<span className='tabText'>Slow</span>} />
                    <Tab className={this.props.classes.tab} id='minorReset' value={10} label={<span className='tabText'>Normal</span>} />
                    <Tab className={this.props.classes.tab} value={5} label={<span className={this.props.classes.tabLabel}>Fast</span>} />
                </Tabs>
                </div>
            </>
        )
    }
}

export default withStyles(useStyles)(NavTop)
